package service;

import model.Customer;

import java.util.ArrayList;
import java.util.List;

public class CustomerServiceImpl implements CustomerService {
    List<Customer> customers= new ArrayList<>();

    public CustomerServiceImpl(){
        customers.add(new Customer("Phuong","01/01/2000","Quang Trung", "data:image/jpeg;base64,"));
        customers.add(new Customer("Tuan", "01/01/2000", "Quang Trung", "data:image/jpeg;base64,"));
        customers.add(new Customer("Phong", "01/01/2000", "Quang Trung", "data:image/jpeg;base64,"));
        customers.add(new Customer("Quang", "01/01/2000", "Quang Trung", "data:image/jpeg;base64,"));
        customers.add(new Customer("Huyen", "01/01/2000", "Quang Trung", "data:image/jpeg;base64,"));

    }


    @Override
    public List<Customer> getAll() {
        return customers;
    }

    @Override
    public void create(Customer customer) {
        customers.add(customer);
    }
}
